import React from 'react'

function ErrorPage(){
    return(
        <>
        <h1 className="errorHead">ERROR PAGE 404</h1>
        <h3 className="errorSub">SORRY THIS PAGE IS UNAVAILABLE !</h3>
        <img className="errorImg" src="https://raw.githubusercontent.com/sandeep-shaw10/reactweb/master/src/Images/search.svg" alt="ERROR 404"/>
        </>
    )
}

export default ErrorPage;
